import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Home.css';
// import heroImage from '../images/hero.jpg'; // Large Portrait
// import dsaImage from '../images/dsa.jpg'; // DSA section Image

function Home() {
  return (
    <div className="home-container">
      {/* Background with "DSA" and Overlapping Steps */}
      <div className="dsa-hero">
        <h1 className="dsa-bg-text">DSA</h1>
        <div className="dsa-steps">
          <div className="step">Understand Problem</div>
          <div className="step">Choose Data Structure</div>
          <div className="step">Pick the Best Algorithm</div>
          <div className="step">Optimize & Analyze</div>
        </div>
      </div>

      {/* DSA Section */}
      <div className="dsa-section">
        <div className="dsa-content">
          <h2>Why Learn DSA?</h2>
          <p>Data Structures & Algorithms are the foundation of efficient coding and competitive programming.</p>
          <ul>
            <li>Improve problem-solving skills</li>
            <li>Crack coding interviews</li>
            <li>Optimize performance in real-world applications</li>
          </ul>
          <Link to="/DSA" className="learn-more-btn">Learn More</Link>
        </div>
        <img src="" alt="DSA Illustration" className="dsa-image" />
      </div>
    </div>
  );
}

export default Home;
